webpackJsonp([0xa675bbaf68fa],{498:function(a,t){a.exports={data:{markdownRemark:{html:'<h2 id="Всем-привет-Внезапно-улкэмп-уже-в-пятницу-поэтому-про-бытовое"><a href="#%D0%92%D1%81%D0%B5%D0%BC-%D0%BF%D1%80%D0%B8%D0%B2%D0%B5%D1%82-%D0%92%D0%BD%D0%B5%D0%B7%D0%B0%D0%BF%D0%BD%D0%BE-%D1%83%D0%BB%D0%BA%D1%8D%D0%BC%D0%BF-%D1%83%D0%B6%D0%B5-%D0%B2-%D0%BF%D1%8F%D1%82%D0%BD%D0%B8%D1%86%D1%83-%D0%BF%D0%BE%D1%8D%D1%82%D0%BE%D0%BC%D1%83-%D0%BF%D1%80%D0%BE-%D0%B1%D1%8B%D1%82%D0%BE%D0%B2%D0%BE%D0%B5" aria-hidden="true" class="anchor"><svg aria-hidden="true" height="16" version="1.1" viewBox="0 0 16 16" width="16"><path fill-rule="evenodd" d="M4 9h1v1H4c-1.5 0-3-1.69-3-3.5S2.55 3 4 3h4c1.45 0 3 1.69 3 3.5 0 1.41-.91 2.72-2 3.25V8.59c.58-.45 1-1.27 1-2.09C10 5.22 8.98 4 8 4H4c-.98 0-2 1.22-2 2.5S3 9 4 9zm9-3h-1v1h1c1 0 2 1.22 2 2.5S13.98 12 13 12H9c-.98 0-2-1.22-2-2.5 0-.83.42-1.64 1-2.09V6.25c-1.09.53-2 1.84-2 3.25C6 11.31 7.55 13 9 13h4c1.45 0 3-1.69 3-3.5S14.5 6 13 6z"></path></svg></a>Всем привет! Внезапно улкэмп уже в пятницу, поэтому про бытовое.</h2>\n<p>Сначала капитанский список необходимого минимума для палаточников, выстраданный мною через обгоревшую башку и залитые кроссовки на предыдущих улкэмпах:</p>\n<ul>\n<li>Пауэрбанк;</li>\n<li>Шляпа/бандана/пакет на голову от солнца;</li>\n<li>Компактный дождевик;</li>\n<li>Обувь, которую можно потом постирать от пыли;</li>\n<li>Запасная обувь (разок на предыдущем месте проведения был шторм, а мы поехали в одних кроссовках, было не очень);</li>\n<li>Хуета от комаров (в поле и на пляже их нет, но ближе к лесу есть);</li>\n<li>Не чёрные шмотки (если будет жара, вам очевидно пизда, если вы в чёрном);</li>\n<li>Минимальная аптечка (какой-нибудь пантенол на случай обгорания, пластыри, перекись/хлоргекс, от похмелья, от поноса и т.д.).</li>\n</ul>\n<p>Это то, что мы берём всегда независимо от погоды.\nВсякие сменные шмотки, полотенца и купальники уж не буду перечислять.\nА если вы решили заплести себе какие-нибудь афрокосы/дреды и поехать в них, то бандану обязательно, у меня на море башка реально обгорела до облезания :) больно, блядь. И в целом неприятно.</p>\n<p>Обувь советовала бы брать на довольно толстой подошве, т.к. или торчащие палки от скошенных растений в поле или мелкие камешки в районе кабаков и домиков.</p>\n<p>Необязательное, но улучшающее качество жизни:</p>\n<ul>\n<li>Повезём сумку-холодильник с генераторами холода и термосами, набитыми льдом;</li>\n<li>Хотим уже приобрести походные стулья, чтобы чиллить в любом месте, в котором приспичит это делать.</li>\n</ul>\n<p>О гигиене.\nНа территории в районе домиков есть открытый душ (по крайней мере был в прошлом году), так что помыться вполне реально.\nТакже советовала бы взять стратегический запас мокрых и сухих салфеток.</p>\n<p>Про купаться.\nМожно и нужно, Волга там заебись и чистая.</p>\n<p>Бабло.\nНал, к сожалению, нужен. В прошлом году интернеты были убогими, так что терминалы просто не могли провести оплату, и все занимали у всех. В этом, вероятно, сделают нормальный интернет (угрожают переносной станцией от Мегафона), конечно, но.</p>\n<p>Отслеживать, что вообще происходит, ПРОНИКНУТЬСЯ ДУХОМ УЛКЭМПА можно по открытому чату улкэмпа – @ulcamp.\nТам же традиционно можно договориться о попутчиках, вписаться к кому-нибудь или кого-нибудь подобрать или вместе поехать на такси (около тыщи в одну сторону, если ехать от Парка Победы в Ульяновске), если вы проебали все бесплатные автобусы.</p>',internal:{content:'---\ntitle: "Гайд по выживанию на Ulcamp 2018"\ncover: "https://tproger.ru/wp-content/uploads/2018/06/ulcamp.jpg"\nauthor: "alcopanda"\ndate: "2018-07-24"\ncategory: ""\ntags:\n    - Ulcamp\n    - Ульяновск\n---\n\n## Всем привет! Внезапно улкэмп уже в пятницу, поэтому про бытовое.\n\nСначала капитанский список необходимого минимума для палаточников, выстраданный мною через обгоревшую башку и залитые кроссовки на предыдущих улкэмпах:\n\n* Пауэрбанк;\n* Шляпа/бандана/пакет на голову от солнца;\n* Компактный дождевик;\n* Обувь, которую можно потом постирать от пыли;\n* Запасная обувь (разок на предыдущем месте проведения был шторм, а мы поехали в одних кроссовках, было не очень);\n* Хуета от комаров (в поле и на пляже их нет, но ближе к лесу есть);\n* Не чёрные шмотки (если будет жара, вам очевидно пизда, если вы в чёрном);\n* Минимальная аптечка (какой-нибудь пантенол на случай обгорания, пластыри, перекись/хлоргекс, от похмелья, от поноса и т.д.).\n\nЭто то, что мы берём всегда независимо от погоды.\nВсякие сменные шмотки, полотенца и купальники уж не буду перечислять.\nА если вы решили заплести себе какие-нибудь афрокосы/дреды и поехать в них, то бандану обязательно, у меня на море башка реально обгорела до облезания :) больно, блядь. И в целом неприятно.\n\nОбувь советовала бы брать на довольно толстой подошве, т.к. или торчащие палки от скошенных растений в поле или мелкие камешки в районе кабаков и домиков.\n\nНеобязательное, но улучшающее качество жизни:\n\n* Повезём сумку-холодильник с генераторами холода и термосами, набитыми льдом;\n* Хотим уже приобрести походные стулья, чтобы чиллить в любом месте, в котором приспичит это делать.\n\nО гигиене.\nНа территории в районе домиков есть открытый душ (по крайней мере был в прошлом году), так что помыться вполне реально.\nТакже советовала бы взять стратегический запас мокрых и сухих салфеток.\n\nПро купаться.\nМожно и нужно, Волга там заебись и чистая.\n\nБабло.\nНал, к сожалению, нужен. В прошлом году интернеты были убогими, так что терминалы просто не могли провести оплату, и все занимали у всех. В этом, вероятно, сделают нормальный интернет (угрожают переносной станцией от Мегафона), конечно, но.\n\nОтслеживать, что вообще происходит, ПРОНИКНУТЬСЯ ДУХОМ УЛКЭМПА можно по открытому чату улкэмпа – @ulcamp.\nТам же традиционно можно договориться о попутчиках, вписаться к кому-нибудь или кого-нибудь подобрать или вместе поехать на такси (около тыщи в одну сторону, если ехать от Парка Победы в Ульяновске), если вы проебали все бесплатные автобусы.\n'},timeToRead:2,excerpt:"\n## Всем привет! Внезапно улкэмп уже в пятницу, поэтому про бытовое.",frontmatter:{title:"Гайд по выживанию на Ulcamp 2018",cover:"https://tproger.ru/wp-content/uploads/2018/06/ulcamp.jpg",date:"2018-07-24",category:"",tags:["Ulcamp","Ульяновск"],author:"alcopanda"},fields:{slug:"/гайд-по-выживанию-на-ulcamp-2018"}},prev:{excerpt:'![2018-06-04](https://hb.bizmrg.com/urbantrip/media/2018-6/4345.jpg "Claus")\n![2018-06-04](https://hb.bizmrg.com/urbantrip/media/2018-6/4346.jpg "Claus")\n<div class="tg-timestamp">12:24</div>Порции слоновьи. ',frontmatter:{title:"Clausы в Финляндии",cover:"https://unsplash.it/1280/500/?random?BoldMage",date:"2018-05-01"},fields:{slug:"/clausы-в-финляндии"}},next:{excerpt:'<div class="tg-timestamp">10:51</div>Всем привет, нас Вова из @UrbanRuTrip не пустил в свой канал, да и хуй с ним. Нам ничего не смогло помешать завести свой.  Завтра мы стартуем из Ульяновска в Казань, а оттуда в Сочи, а оттуда в Абхазию. Едем мы, честно говоря, пожрать, выпить, пребывать в режиме бесполезной мрази. Ну и посетить пару-тройку достопримечательностей, может быть сгоняем в соседние города. Мы не рассчитываем на дохуя подписчиков, т.к. мы опять воспринимаем канал как записную книжку и облачное хранилище фоток.  Сначала я хотела запилить лонгрид с всяким полезным по итогам, потом вспомнила, что нихуя не запоминаю, если сразу это не записываю, так что буду писать сюда, а потом мож выкачу текст с выжимкой. Зачем? Затем что я очень заебалась гуглить про Абхазию, никто не пишет ничего полезного, все высирают 9000 фоток, сопровождая это всё текстами в духе «Охуенно-заебись, всё очень вкусно, вот фотка монастыря, а вот кусок текста из вики». +Охулиард рассказов, как же там всё хуёво, нет сервиса и так далее. Опять же с нулём конкретики. Ну, охуеть теперь. В общем, надеюсь в итоге написать полезных рекомендаций.  Постить будем примерно в таком же формате, как в УрбанТрипе. Оставайтесь на связи. ',frontmatter:{title:"Алкотрип в Абхазию",cover:"http://v-georgia.com/wp-content/uploads/2017/09/shutterstock_1480655391-1920x12801500.jpg",date:"2018-06-13"},fields:{slug:"/алкотрип-в-абхазию"}},authors:{edges:[{node:{id:"Boris T",name:"Борис",image:"https://hb.bizmrg.com/urbantrip/media/avatars/boris.jpg",url:"http://gatsbyjs.org/",bio:"Лучше звоните борису"}},{node:{id:"Claus",name:"Claus",image:"https://hb.bizmrg.com/urbantrip/media/avatars/vladimir.jpg",url:"http://gatsbyjs.org/",bio:"Просто Claus"}},{node:{id:"Vladimir",name:"Urban",image:"https://hb.bizmrg.com/urbantrip/media/avatars/vladimir.jpg",url:"http://gatsbyjs.org/",bio:"Просто вова"}},{node:{id:"alcopanda",name:"Маша Милованова",image:"https://hb.bizmrg.com/urbantrip/media/avatars/alcopanda.jpg",url:"http://gatsbyjs.org/",bio:"Маша. @zhptrs @fokincookin"}},{node:{id:"casper",name:"Casper User",image:"https://api.adorable.io/avatars/150/test.png",url:"http://gatsbyjs.org/",bio:"Yeah, I like animals better than people sometimes... Especially dogs. Dogs are the best. Every time you come home, they act like they haven't seen you in a year. And the good thing about dogs... is they got different dogs for different people."}},{node:{id:"guinevere",name:"Guinevere Kuiper",image:"https://randomuser.me/api/portraits/women/17.jpg",url:"https://randomuser.me/api/?seed=user1",bio:"Lorem ipsum dolor sit amet, consectetur adipiscing elit. Nullam laoreet lorem nec ligula aliquet, porta blandit augue luctus. Vivamus ac quam diam. Sed vestibulum pharetra hendrerit."}}]}},pathContext:{slug:"/гайд-по-выживанию-на-ulcamp-2018",total:5,prev:"/clausы-в-финляндии",next:"/алкотрип-в-абхазию"}}}});
